// TodoTemplate

import React, { useState } from "react";
import TodoList from "./TodoList";
import { AiFillSetting } from "react-icons/ai";

const Main = () => {
  const [todos, setTodos] = useState([
    {
      id: 1,
      text: "머리감기",
      checked: false,
    },
    {
      id: 2,
      text: "노트북 부시기",
      checked: true,
    },
    {
      id: 3,
      text: "키보드 샷건치기",
      checked: true,
    },
  ]);

  return (
    <>
      <div className="title">오늘의 할일({todos.length})</div>

      <TodoList todos={todos} />
      <div>AiFillSetting</div>
    </>
  );
};

export default Main;
